import Mixins from '@/mixins'
import { mapState } from 'vuex'
import AttrbuteTable from './attrbuteTable'
export default {
  mixins: [Mixins],
  props: {
    value: {
      type: Array
    },
    showBtn: {
      type: Boolean,
      default: false
    },
    showAttr: {
      type: Boolean,
      default: false
    }
  },
  computed: {
    ...mapState({
      objectList: state => state.SetUpData.objectData
    }),
    tableHeight () {
      return window.innerHeight - 60 - 50 - 40 - 80
    }
  },
  data () {
    return {
      minWidth: '100px',
      multipleSelection: []
    }
  },
  methods: {
    handleSelectionChange (val) {
      this.multipleSelection = val
      this.$emit('input', this.multipleSelection)
    },
    go (row) {
      this.$router.push({ name: 'Configuration-edit', params: { data: row.objn } })
    }
  },
  watch: {
    value (val) {
      this.multipleSelection = val
    }
  },
  components: {
    AttrbuteTable
  }
}
